import React from 'react'
import Header from './Header'
import Cornellnotes from './templates/cornell/Cornellnotes'

export default function App (params) {
  return (
    <div>
      <Header />
      <Cornellnotes
        title={'Class 1'}
        keywords={['data', 'structure', 'algorithm']}
        note={{text: 'Imagine traveling to a new country and you don’t know how to speak their native language. When you enter the world of programming, English and all the languages you know become alien to the computer. You need to have clear communication with your computer and the only way to do that is by learning the ABCDs of a programming language.'
        }}
        summary={
          'DSA is important. DS used to store data in different forms. Algorithm is how you perform an action.'
        }
      />
    </div>
  )
}
